import React from "react";
import "./Hello.css";

function Hello() {
  const PracticeStyle = {
    marginTop: "10px",
    backgroundColor: "blue",
  };
  return (
    <>
      <div class="red">Hello World!</div>
      <div style={PracticeStyle}>Hello World!</div>
      <div style={PracticeStyle}>Hello World!</div>
    </>
  );
}

export default Hello;
